SELECT DISTINCT
       RAZAOSOCIALINSTENSINO,
       INSCRICAOINSTENSINO,
       CEPINSTENSINO,
       DESCLOGRADINSTENSINO,
       NROLOGRADINSTENSINO,
       BAIRROINSTENSINO,
       CIDADEINSTENSINO,
       UFINSTENSINO,
       CODMUNICIPINSTENSINO
  FROM RHCONTRATOS
 WHERE INSCRICAOINSTENSINO IS NOT NULL
   AND INSCRICAOINSTENSINO <> '';